try{!function(t){if("function"!=typeof t)throw"제이쿼리가 없습니다.";t.fn.moveFocus=function(){var t=this.first(),r=t.attr("tabindex");return r||t.attr("tabindex",-1),t.focus(),r||t.removeAttr("tabindex"),this}}(window.jQuery)}catch(t){console.error(t)}